function v_type_price(t){return 1==t?"무료":2==t?"유료":void 0}function v_readonly_str(t){return 0==t?"정상":1==t?"읽기 전용":void 0}function v_readonly_btn_str(t){return 0==t?"읽기 전용":"읽기 전용 해제"}function v_stop_str(t){return 0==t?"정상":1==t?"정지":void 0}function v_stop_btn_str(t){return 0==t?"정지":"정지 해제"}function v_space(t){msite.space_table.clear(),msite.space_table.state.clear();let a=new Array;const s=t.space_seq.length;for(i=0;i<s;++i)a.push([t.space_seq[i],`<div class="over_wrapper">${t.name[i]}</div>`,`<div class="over_wrapper">${t.note[i]}</div>`,t.state[i],t.database_seq[i],v_type_price(t.type_price[i]),moment.unix(t.ctime[i]).format("lll"),moment.unix(t.upgrade_ctime[i]).format("lll"),v_readonly_str(t.is_restriction_readonly[i]),v_stop_str(t.is_restriction_stop[i]),`<div id="space_controll_btns" data-space_seq="${t.space_seq[i]}"\ndata-readonly="${t.is_restriction_readonly[i]}"\ndata-stop="${t.is_restriction_stop[i]}"">\n<div>\n<div id="space_account_list_btn" class="btn btn-normal btn-xs">사용자</div>\n<div id="space_mspace_btn" class="btn btn-default btn-xs">관리</div>\n<div id="space_tree_btn" class="btn btn-default btn-xs">스페이스</div>\n</div>\n<div>\n<div id="space_readonly_btn" class="btn btn-danger btn-xs">${v_readonly_btn_str(Boolean(t.is_restriction_readonly[i]))}</div>\n<div id="space_stop_btn" class="btn btn-warning btn-xs">${v_stop_btn_str(Boolean(t.is_restriction_stop[i]))}</div>\n</div>\n</div>`]);msite.space_table.rows.add(a),msite.space_table.draw()}function v_space_detail(t){msite.space_detail_table.clear(),msite.space_detail_table.state.clear();let a=new Array;const s=t.list_space.space_seq.length;for(i=0;i<s;++i)a.push([t.list_space.space_seq[i],`<div id="space_list_btn" class="btn btn-normal btn-xs" data-space_seq="${t.list_space.space_seq[i]}">사용자</div>`,t.list_space.name[i],t.list_space.note[i],t.list_space.state[i],t.list_space.database_seq[i],t.list_space.type_price[i],moment.unix(t.list_space.ctime[i]).format("lll"),moment.unix(t.list_space.upgrade_ctime[i]).format("lll")]);msite.space_detail_table.rows.add(a),msite.space_detail_table.draw()}function v_account_state_tag(t){switch(t){case 1:return"정상";case 2:return"정지";case 3:return"탈퇴";case 4:return"삭제"}}function v_account_admin_tag(t){return 1==t?'<i class="far fa-check-square fa-lg text-success"></i>':'<i class="far fa-square fa-lg text-gray"></i>'}function v_space_account_list(t,a){msite.space_account_list_table.clear(),msite.space_account_list_table.state.clear();let s=new Array;const e=t.account_seq.length;for(i=0;i<e;++i)s.push([t.account_seq[i],t.name[i],t.intro[i],`<div class="state_group">\n<span>${v_account_state_tag(t.state_account[i])}</span>\n<div id="set_state_normal_btn" class="btn btn-primary btn-xs" data-account_seq="${t.account_seq[i]}" data-space_seq="${a}">정상</div>\n<div id="set_state_stop_btn" class="btn btn-warning btn-xs" data-account_seq="${t.account_seq[i]}" data-space_seq="${a}">정지</div>\n<div id="set_state_leave_btn" class="btn btn-danger btn-xs" data-account_seq="${t.account_seq[i]}" data-space_seq="${a}">탈퇴</div>\n</div>`,v_account_admin_tag(Boolean(t.is_space_admin[i]))]);msite.space_account_list_table.rows.add(s),msite.space_account_list_table.draw()}